# # D√©tection des biomarqueurs dans les tweets
# 
# 
# 
# ## M√©thode initiale
# 
# Afin de compter les occurrences des biomarqueurs dans les tweets, la m√©thode initiale consistait √† rechercher simplement les cha√Ænes de caract√®res correspondant aux noms des biomarqueurs en prenant ou non en compte la casse. Pour rappel, les biomarqueurs pris en compte sont: *ROS1, ALK, EXON, EGFR, KRAS, NTRK, BRAF, MET, RET, HER2*.
