# ## D√©finition d'expressions r√©guli√®res plus complexes
# 
# Des expressions r√©guli√®res plus "complexes" ont alors √©t√© d√©finies pour exclure les faux-amis √©voqu√©s ci-dessus et d'autres du d√©comptes des occurrences. Le script utilis√© et affich√© dans la cellule ci-dessous fonctionne de la fa√ßon suivante:
# 
# 1. Pour chaque tweet, on commence par remplacer plusieurs signes de ponctuations ("/", ".", ",", "-") par des espaces.
# 
# 
# 2. Une fois le remplacement effectu√©, chaque tweets est d√©coup√© afin d'obtenir la liste de toutes les cha√Ænes de caract√®re pr√©c√©d√©es et suivies par un espace (dans le script ci-dessous, cette liste est nomm√©e "tt").
# 
# 
# 3. puis on recherche la pr√©sence de chaque biormaqueur au sein de cette liste selon des expressions r√©guli√®res. Par exemple, dans le cas du biomarqueur "MET", nous avons utilis√© l'expression r√©guli√®re suivante (avec x est √©gale √† "MET" et le signe "|" qui signifie "ou"):
# 
# `"{x}[(+)]" | "[#@+]{x}[^AaSsUuEeYyHh]" | "[#@+]{x}$" | "^{x}[^AaSsUuEeYyHh]" | "^{x}$"`
#     
#    
# C'est-√†-dire que pour chaque terme de la liste "tt", celui-ci sera consid√©r√© comme une occurrence du biomarqueur "MET" si, et seulement si "MET" :
#     
# - est suivi du signe +" 
#     
# - **ou** est pr√©c√©d√© par un hashtag ou un arobase et suivi par un ou plusieurs caract√®res sauf les lettres majuscules ou minuscules *a, s, u, e, y, h*. 
#     
# - **ou** est pr√©c√©d√© par un hashtag, un arobase ou le signe "+" et n'est suivi par aucun caract√®res
#     
# - **ou** n'est pr√©c√©d√© par aucun caract√®re et n'est pas suivi par les lettres *a, s, u, e, y, h* majuscules ou minuscules". Dans ce cas, l'expression "METUProg" n'est pas prise en compte √† la diff√©rence de "METmuts" 
#     
# - **ou** n'est pr√©c√©d√© ni suivi de caract√®res.
#     
# Si certaines r√®gles sont communes √† l'ensemble des biomarqueurs, d'autres sont sp√©cifiques. Par exemple, dans le cas du biomarqueur "RET", les lettres  *a, s, u, e, y, h* sont remplac√©es par *a, e, i, o, u, r, h, z, w* pour √©viter que des mots comme "retweet" soient compt√©s. √Ä noter √©galement que dans le cas des biomarqueurs "ALK", "MET" et "RET", on ne prend en compte que les formes en majuscule. Pour les autres, l'algorithme de recherche est insensible √† la casse.
# 
# Enfin, ces expressions r√©guli√®res sont recherch√©es √† l'aide de la fonction "search" du module *re* du langage Python. Cette fonction retourne "vrai" si l'expression est trouv√©e, "faux" dans le cas contraire. Par ailleurs, elle s'arr√™te √† la premi√®re expression trouv√©e. Autrement dit, la fonction indique simplement si l'expression est pr√©sente quelque soit le nombre de fois o√π elle appara√Æt dans le tweet. Le tableau ci-apr√®s illustre le r√©sultat obtenu pour une dizaine de phrases avec chacune des deux m√©thodes (sans ou avec les expressions r√©guli√®res).
# 
# La principale limite de cette seconde m√©thode est qu'elle conduit √† d√©finir de nombreuses exceptions pour √©viter que des "vrais positifs" soit trait√©s comme des "faux positifs". Ainsi, la r√®gle qui consiste √† ne pas compter les cha√Ænes de caract√®re constitu√©es de MET suivi d'un "a", comme *METastasis*, a pour effet √©galement d'exclure les formes du types *METamp*. La liste des formes exclues est plac√©e √† la fin de ce document.
# 

# :::{admonition} Illustration de l'algorythme
# 
# 1. Le tweet initial : 
# 
# >"MET copy number as a secondary driver of EGFR TKI resistance in EGFR-mutant NSCLC http://bit.ly/2HfGHjn #editorial #lcsm"</p>
#     
# 2. Le tweet nettoy√© (les "/", ".", "," et "-" sont remplac√©s par des espaces) : 
# 
# > "MET copy number as a secondary driver of EGFR TKI resistance in EGFR mutant NSCLC http:  bit ly 2HfGHjn #editorial #lcsm"
#     
# 3. On cr√©e une liste de toutes les cha√Ænes de caract√®re pr√©c√©d√©es et suivies par une espace :
# 
# > ['MET', 'copy', 'number', 'as', 'a', 'secondary', 'driver', 'of', 'EGFR', 'TKI', 'resistance', 'in', 'EGFR', 'mutant', 'NSCLC', 'http:', '', 'bit', 'ly', '2HfGHjn', '#editorial', '#lcsm']
#     
# 4. La recherche du biomarqueur se fait ensuite √† partir de la liste des termes entre crochets ci-dessus. Dans cet exemple, on a bien le terme "MET". On constate que le tweet fait √©galment r√©f√©rence au biomarqueur EGFR.
# 
# :::
# 
# 

